import { Button, Card } from "antd";

const PostCard = () => {
  return;
  <div>
    <Card 
    cover={post.Images[0]
    && <PostImages />}>
      <Image />

      <Content />

      <Buttons></Buttons>
    </Card>
  </div>;
};

export default PostCard;
